import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Main Menu</h1>
      <button>Continue</button>
      <button>New Game</button>
      <button>Options</button>
      <button>Quite Game</button>
    </div>
  );
}

export default App;
